The Mountain Bike Hall of Fame 2023 has been announced. Congratulations to all of them, they each had a huge ripple effect in our sport and/or industry; on and off the bike. Please read their full bios / nominations on the @marinmuseumofbicycling website (link is in my bio). 
@palmer555 changed gravity riding he brought attitude and notoriety to our sport
Diddie Schneider is and has been one of the greatest visionaries in mountain biking, purpose built trails are just one of his contributions @mtbzone_bikeparkgeisskopf 
@robwarner970 is a personality on and off the bike, he was there in the Golden Era and his commentary has made him synonymous w racing
@mtbgunnrita is a legend and has raced on a World level for over 30 years, her many titles are very impressive 
Induction ceremonies will be Oct. 7th ‘23 in Fairfax,CA, you can meet these and many other legends there. Ticket info will be on the website when the time comes.

