Almost 120 years of @adidas @adidasterrex connects the four of us. Last weekend was the retirement party of @axel.burkhardt (top left), he worked at @adidasterrex for over 30 years, he shaped athletes, events and multiple disciplines not just in cycling but also all outdoor and winter sports. He was there (not just as a sponsor) when in MTB Transalp, Cape Epic, Freeride Slopestyle happened. Sickline for kayaking, Rockstars for climbers, etc…. From flying to trail running, Nordic ski events, bob …. Axel shaped entire sports and elevated the standards, gave credibility to the brand and last but not least thanks to him I still have a strong partnership w Adidas after three decades. Thank you Axel, Adi Dassler would be proud. 
